def calculating_distances(main_picture, sample_percent, sample_distances, sample_feature):
    distance, percent = [0, 0]
    sample_feature = np.power(np.tanh(sample_feature), 2) * 120000
    main_picture = np.asarray(main_picture)
    sample_percent = np.asarray(sample_percent)
    minimum_value = np.amin(sample_distances)
    if minimum_value > 20:
        print("Too Much Difference!\n")
    else:
        distance = np.sum(main_picture * np.power(sample_distances, 2))
        for i in range(0, len(main_picture)):
            for j in range(0, len(sample_percent)):
                percent += (sample_percent[j] / main_picture[i]) * (sample_percent[j] - main_picture[i]) ** 2
        return distance + percent + sample_feature

